import './App.css';
import Hero from './components/Hero/Hero'
import Programs from './components/Programs/Programs'
// import Header from 'components/Header/Header'

function App() {
  return (
    <div className="App">
          <Hero />
          <Programs />
    </div>
  );
}

export default App;
